import React from "react";

function HomeWork_1(props) {
    return(
        <div className="boxs">
            <div className="box">
                <img src="https://picsum.photos/100" />
                <h4> Name : {props.name} </h4>
                <h4> Position : {props.position} </h4>
                <h4> Website : {props.website} </h4>
            </div>
        </div>
    );
}

export default HomeWork_1;
